description:
Verenigde Staten
Actie / Science-Fiction
118 minuten

zeer goeie film

met Channing Tatum, Sienna Miller en Marlon Wayans

Tien jaar in de toekomst moet het elite korps dat bekend staat als G.I. Joe het opnemen tegen de kwaadaardige organisatie Cobra, 
onder leiding van de Schotse wapenhandelaar Destro. Het elite G.I. Joe team gaat met futuristische spionage en militaire 
apparatuur de strijd aan met de corrupte Destro en de steeds gevaarlijker wordende organisatie Cobra om de wereld te redden van 
totale chaos...
